const App = () => {
  const [serverErrors, setServerErrors] = useState([]);
  const [menu, setMenu] = useState();
  const [usrInfo, setUsrInfo] = useState("");
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [sessionStorageUpdated, setSessionStorageUpdated] = useState(false);

  useEffect(() => {
    console.log("From App");
    let fetching = false;
    let loginStatus = false;
    async function fetchData() {
      sessionStorage.removeItem("isLoggedIn");
      sessionStorage.removeItem("usr");
      if (!fetching) {
        await axios
          .get("/loginDetails/isLoggedIn")
          .then((response) => {
            if (response.data) {
              setIsLoggedIn(true);
              loginStatus = true;
              sessionStorage.setItem("isLoggedIn", response.data);
            }
          })
          .catch((error) => {
            if (error.response) setServerErrors(error.response.data.error);
            else setServerErrors(error.Error);
          });
      }

      if (loginStatus) {
        await axios
          .get("/menus?filter=usr")
          .then((response) => {
            //console.log(response.data);
            //console.log(typeof response.data);
            if (typeof response.data[0] !== "string") {
              //json menu data is an object
              //setData(response.data);
              setMenu(response.data[0]);
              //console.log(menu);
            }
            if (typeof response.data[1] === "string" && response.data[1]) {
              //json menu data is an object
              //setData(response.data);
              setUsrInfo(response.data[1]);
              //console.log(menu);
            }
          })
          .catch((error) => {
            //console.log(error);
            //console.log(error.response.status);
            //console.log(error.response.headers);
            if (error.response) setServerErrors(error.response.data.error);
            else setServerErrors(error.Error);
          });

        await axios
          .get("/usrs/loggedInUsr")
          .then((response) => {
            sessionStorage.setItem("usr", JSON.stringify(response.data));
          })
          .catch((error) => {
            if (error.response) setServerErrors(error.response.data.error);
            else setServerErrors(error.Error);
          });
      }

      setSessionStorageUpdated(true);
    }

    fetchData();
    //console.log(menu);
    return () => {
      fetching = true;
    };
  }, []);

  return (
    <Router basename={process.env.REACT_APP_ROUTER_BASE || ""}>
      <AppNavBar menu={menu} />
      {sessionStorageUpdated ? (
        <>
          {isLoggedIn ? (
            <Switch>
              {/* <Route path="/" exact={true} component={Home} /> */}
              <Route
                path="/"
                exact={true}
                render={() => <Home isLoggedIn={isLoggedIn} />}
              />
              <Route path="/kitchen" component={KitchenSink} />
              <Route path="/files" component={FileList} />
              <Route
                path="/cbillTadaLtcs/printDebitClaims"
                exact={true}
                component={PrintDebitAdjReport}
              />
              <Route
                path="/payments/paymentSummary"
                exact={true}
                component={CmpSummary}
              />
              <Route
                path="/schedule3s/cmpGen"
                exact={true}
                component={CmpGeneration}
              />
              <Route
                path="/chequeSlips/dpsList"
                exact={true}
                component={DpSheetList}
              />
              <Route
                path="/cbillTadaLtcInputs/upload/advances"
                exact={true}
                component={UploadTadaAdvance}
              />
              <Route path="/pms" exact={true} component={PrintPmCs} />
              <Route
                path="/pms/0/rollbackLoad"
                exact={true}
                component={Rollback}
              />
              <Route
                path="/payElements"
                exact={true}
